//import logo from './logo.svg';
import React from 'react';
import Navbar from "react-bootstrap/Navbar";
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import CreateStudent from "./component/create-student.component";
import EditStudent from "./component/edit-student.component";
import StudentList from "./component/student-list.component";


function App() {
  return (
    <div className="App">
      <Router>
        <header className="App-header">

          <Navbar bg="primary" variant="dark">
            <Container>
              <Navbar.Brand>
                <Link to={"/student-list"} className="nav-link" >

                Laboratorio Henrry Montañez</Link>
              </Navbar.Brand>

                <Nav className = "justify-content-end" > 

                <Nav>
                  <Link to = {"/student-list"} className = "nav-link" >
                  <svg xmlns="http://www.w3.org/2000/svg" width="35" height="35" fill="currentColor" class="bi bi-house-fill" viewBox="0 0 16 16">
                  <path d="M8.707 1.5a1 1 0 0 0-1.414 0L.646 8.146a.5.5 0 0 0 .708.708L8 2.207l6.646 6.647a.5.5 0 0 0 .708-.708L13 5.793V2.5a.5.5 0 0 0-.5-.5h-1a.5.5 0 0 0-.5.5v1.293L8.707 1.5Z"/>
                  <path d="m8 3.293 6 6V13.5a1.5 1.5 0 0 1-1.5 1.5h-9A1.5 1.5 0 0 1 2 13.5V9.293l6-6Z"/></svg>
                  </Link>
                </Nav>

                <Nav>
                  <Link to = {"/edit-student"} className = "nav-link" >
                    Conocenos
                  </Link>
                </Nav>

                <Nav>
                  <Link to = {"#!"} className = "nav-link" >

                  </Link>
                </Nav>

              </Nav>
            </Container>
          </Navbar>
        </header> 
        <Container>
          <Row>
            <Col md={12}>
              <div className="wrapper">
                <Switch>
                  <Route
                    exact
                    path="/"
                    component={(props) =><CreateStudent{...props} />}
                  />
                  <Route
                    exact
                    path="/create-student"
                    component={(props) =><CreateStudent{...props} />}
                  />
                  <Route
                    exact
                    path="/edit-student/:id"
                    component={(props) =><EditStudent{...props} />}
                  />
                  <Route
                    exact
                    path="/student-list"
                    component={(props) =><StudentList{...props} />}
                  />
                </Switch>
              </div>
            </Col>
          </Row>
        </Container> 
      </Router> 
    </div>
  );
}

export default App;
